select ROW_NUMBER() OVER(order BY ItemCode),* from (
SELECT ItemCode,SUM(QUANTITY) as Quantity,Uom FROM FCT2 where absid = :1  GROUP BY AbsId,ItemCode,Uom
)as A ORDER BY ITEMCODE ASC

